                        <img src={SettingsIcon} alt="" /> {/* Settings Icon */}
                    </div>
                    {/* End of Header Inner Container */}

                </div>
                {/* End of Player Statistics Header Section */}

                <MapSection
                    zoomLevel={20}
                    className="map-section"
                />
            </div>
        );
    }
}


const location = {
    lat: 51.523,
    lng: -2.578499,
    text: "Aerospace Museum"
}

export default GameMenu;
